import React from 'react'
import { Helmet } from 'react-helmet'

class TitleSetter extends React.PureComponent {
  render () {
    return (
      <>
        <Helmet>
          <title><b>Ultimate Cat Site</b></title>
        </Helmet>
      </>
    )
  }
}

export default TitleSetter
